export function OpenPage(x: any,y: any){
    var indice = x
    var target = y

    //'../Formularios/Teste'
    var CaminhoForm = '../Formularios/' + indice
        
    var doc = document.getElementById(target);

    var xml = new XMLHttpRequest()
  
      xml.onreadystatechange = function ()
      {
        var doc = document.getElementById(target);
            
        if(doc != null)
        {
          doc.innerHTML = xml.responseText;
        }    
      }

    xml.open('GET', CaminhoForm, true)

    xml.send()
}
